let users = {
  Alan: {
    age: 27,
    online: false
  },
  Jeff: {
    age: 32,
    online: true
  },
  Sarah: {
    age: 48,
    online: false
  },
  Ryan: {
    age: 19,
    online: true
  }
};

function countOnline(obj) {
  let count = 0; // Initialize a counter

  for (let user in obj) {
    if (obj[user].online) {
      count++; // Increment the counter if the user is online
    }
  }

  return count; // Return the count
}
